import React from 'react';
import './App.css';
import Header from './Components/Header/Header'
import { useRoutes } from './routes'

import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";


function App() {

  const routes = useRoutes(false)

  return (
    <Router>
      <Header />
      <div>
        {routes}
      </div>
    </Router>
  );
}

export default App;
